import { useEffect, useState } from 'react';
import './Women.css'
import { useQuery, gql } from "@apollo/client";
import {dquery} from '../../../GraphQL/Queries'


function Women() {
  
  const {error, loading, data } = useQuery(dquery)
  const {products, getProducts} = useState()

  useEffect(() => {
    getProducts(data.Product)
  }, [data])

  return (
    <div className="Women">
      <h1>Category Name</h1>
          <div className='boxes'>
            <div className="box">
              </div>
                  <div className="box">
                 {products.map((val) => {
                  return <div> {val.id} </div>
                 })}
              </div>
        </div>
    </div>
  )
}

export default Women
